import NFLPlayer from './NFLPlayer'

const NFLPlayers = ({ nflPlayers }) => {
  return (
    <>
      {nflPlayers.map((nflPlayer) => (
        <NFLPlayer nflPlayer={nflPlayer} />
      ))}
    </>
  )
}

export default NFLPlayers
